Any Less Anymore is out everywhere now. It's been a massive week or so leading into release day. Thanks to everyone that came to any of the Listening Parties or Tour Dates.. It's been a week I won't forget anytime soon.

Late nights, early mornings, lots of travel, lots of chatting and meeting people. 🤟

