2023 has been pretty wild.. but I can't even begin to say how grateful I am for this!! 

"Longest running #1 on country radio by Australian artist(s), from the highest ARIA charting country album by an Aussie artist in over two years.."

Huge props to country radio for the love around 'Runnin The Country', and a SIX week run at the top.. and massive thanks to my fans/supporters for the album successes. Nothin' but love to you all!

